import React, {Component} from 'react'
import App from './App'
import Card from './Card'

export default class DisplayList extends Component {

    constructor() {
        super()
    }



    render() {
        return (
            <div>
                {this.props.list.map (item =>
                    <li>{item.name}, {item.type}, {item.exotic} </li>)}


                <Card newCard = {this.props.list} />

            </div>

        )
    }
}
